import React, { useState } from 'react'
import "./navbar.css";
import playbttn from './icon/play-button.png'
import io from './icon/control-center.png'
import siri from './icon/siri.png'
import applestore from './icon/applestore.png'
import setting from './icon/setting.png'
import contact from './icon/contact.png'
import imsg from './icon/imessage.png'
import facetime from './icon/facetime.png'
import applemusic from './icon/applemusic.png'
import pinterest from './icon/pinterest.png'
import launchpad from './icon/launchedpad.png'
import finder from './icon/finder.png.jpeg'
import bin from './icon/bin.png'





export default function Navbar() {
  const [dropdownVisible, setDropdownVisible] = useState(false);

  // Function to toggle the dropdown visibility
  const toggleDropdown = () => {
    setDropdownVisible(!dropdownVisible);
  };


    const [time ,setTime]=useState(o);
    const weekday = ["Sun","Mon","Tue","Wed","Thu","Fri","Sat"];
    const month = ["Jan","Feb","Mar","Apr","May","Jun","Jul","Aug","Sep","Oct","Nov","Dec"];
    var currentdate = new Date();
    var currenttime = new Date();
    var min = currenttime.getMinutes();
    var hours = currenttime.getHours();
    var hr = hours%12||12;
    const Am =  hours >=12 ? "PM" : "AM";
    var o = weekday[currentdate.getDay()]+" "+currentdate.getDate()+" "+month[currentdate.getMonth()]+" "+hr+":"+min+" "+Am;
    function updateTime(){
      setTime(o);
    }
    setInterval(updateTime,3000);
  return (
    <>
     <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css"></link>
 <body>
    <div className='nav'>
      <div className="left">
      <div className="dropdown">
          <a onClick={toggleDropdown}><i className="fa fa-apple"></i></a>

        </div>
      <a><i className="fa fa-apple"></i></a>
      <a><strong>Finder</strong></a>
      <a>File</a>
      <a>Edit</a>
      <a>View</a>
      <a>Go</a>
      <a>Window</a>
      <a>Help</a>
      </div>
      <div className="right">
      <a><img className='playbttn' src={playbttn}/></a>
      <a className='wifi'><i className='fa fa-wifi'></i></a>
      <a><i className='fa fa-search'></i></a>
      <a><img className='io' src={io}/></a>
      <a><img className='siri' src={siri}/></a>
      <a><strong>{time}</strong></a>
      </div>
    </div>
    {dropdownVisible && (
            <div className="dropdown-content">
              <a>Item 1</a>
              <a>Item 2</a>
              <a>Item 3</a>
            </div>
          )}
     <div className="dock">
        <div className="apps">
            <a><img src={finder} alt="" className="finder" /></a>
            <a><img src={launchpad} alt="" className="launchpad" /></a>
            <a><img src={pinterest} alt="" className="pinterest" /></a>
            <a><img src={imsg} alt="" className="imsg" /></a>
            <a><img src={applemusic} alt="" className="applemusic" /></a>
            <a><img src={facetime} alt="" className="facetime" /></a>
            <a><img src={contact} alt="" className="contact" /></a>
            <a><img className='store' src={applestore}/></a>
            <a><img src={setting} alt="" className="sett" /></a>
            <a><img src={bin} alt="" className="bin" /></a>
        </div>
   </div>
 </body>
  </>
  )
}
